        </div>
        {/* <label className="story">Generate Text to Speech:</label> */}
        <div className="card-body">
        <textarea id="story" name="story" rows="20" cols="100" maxLength="500"> Type Here..</textarea>
        </div>
        <div className="card-footer">
          <span className="font-weight-bold" id="wordcount">500 characters</span>
        </div>
        </form>

        
      
    )
  }
}
